import React, { useState } from 'react';
import { Container, Row, Col, Form } from 'react-bootstrap';
import ProductCard from '../components/ProductCard';

const HomePage = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedCategory, setSelectedCategory] = useState('');

  // Hardcoded products data
  const products = [
    {
      id: 1,
      name: "Premium Wireless Headphones",
      description: "High-quality wireless headphones with noise cancellation",
      price: 199.99,
      category: "Electronics",
      image: "https://m.media-amazon.com/images/I/71o8Q5XJS5L._AC_UF1000,1000_QL80_.jpg",
      stock: 15
    },
    {
      id: 2,
      name: "Smart Fitness Watch",
      description: "Track your fitness goals with this advanced smartwatch",
      price: 149.99,
      category: "Electronics",
      image: "https://pisces.bbystatic.com/image2/BestBuy_US/images/products/6573/6573194_sd.jpg",
      stock: 20
    },
    {
      id: 3,
      name: "Organic Cotton T-Shirt",
      description: "Comfortable and eco-friendly cotton t-shirt",
      price: 29.99,
      category: "Clothing",
      image: "https://images.coach.com/is/image/Coach/cr035_blk_a0?$desktopProduct$",
      stock: 50
    },
    {
      id: 4,
      name: "Professional Camera Lens",
      description: "50mm prime lens for professional photography",
      price: 599.99,
      category: "Photography",
      image: "https://www.bhphotovideo.com/cdn-cgi/image/format=auto,fit=scale-down,width=500,quality=95/https://www.bhphotovideo.com/images/images500x500/canon_ef_600mm_f_4l_is_1433722.jpg",
      stock: 8
    },
    {
      id: 5,
      name: "Gaming Laptop",
      description: "High-performance laptop for gaming enthusiasts",
      price: 1299.99,
      category: "Electronics",
      image: "https://m.media-amazon.com/images/I/71HG+-2wv+L._AC_UF1000,1000_QL80_.jpg",
      stock: 10
    },
    {
      id: 6,
      name: "Leather Wallet",
      description: "Genuine leather wallet with multiple card slots",
      price: 49.99,
      category: "Accessories",
      image: "https://m.media-amazon.com/images/I/91DvKSLuuPL._AC_UY1000_.jpg",
      stock: 30
    },
    {
      id: 7,
      name: "Mechanical Keyboard",
      description: "RGB mechanical keyboard with custom switches",
      price: 129.99,
      category: "Electronics",
      image: "https://i.imgur.com/Md6xp7s.jpg",
      stock: 25
    },
    {
      id: 8,
      name: "Running Shoes",
      description: "Lightweight and comfortable running shoes",
      price: 89.99,
      category: "Footwear",
      image: "https://m.media-amazon.com/images/I/71ZDY57RTbL._AC_UX575_.jpg",
      stock: 40
    },
    {
      id: 9,
      name: "Wireless Mouse",
      description: "Ergonomic wireless mouse with long battery life",
      price: 39.99,
      category: "Electronics",
      image: "https://m.media-amazon.com/images/I/61UxfXTUyvL._AC_UF1000,1000_QL80_.jpg",
      stock: 35
    },
    {
      id: 10,
      name: "Backpack",
      description: "Durable backpack with laptop compartment",
      price: 79.99,
      category: "Accessories",
      image: "https://m.media-amazon.com/images/I/71HJY-K+9-L._AC_UF1000,1000_QL80_.jpg",
      stock: 22
    }
  ];

  // Get unique categories from products
  const categories = [...new Set(products.map(product => product.category))];

  // Filter products based on search term and category
  const filteredProducts = products.filter(product => {
    const matchesSearch = product.name.toLowerCase().includes(searchTerm.toLowerCase()) || 
                         product.description.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesCategory = selectedCategory === '' || product.category === selectedCategory;

    return matchesSearch && matchesCategory;
  });

  return (
    <Container>
      <h1 className="mb-4">Products</h1>

      <Row className="mb-4">
        <Col md={6}>
          <Form.Group>
            <Form.Control
              type="text"
              placeholder="Search products..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
          </Form.Group>
        </Col>
        <Col md={6}>
          <Form.Group>
            <Form.Select
              value={selectedCategory}
              onChange={(e) => setSelectedCategory(e.target.value)}
            >
              <option value="">All Categories</option>
              {categories.map(category => (
                <option key={category} value={category}>{category}</option>
              ))}
            </Form.Select>
          </Form.Group>
        </Col>
      </Row>

      <Row xs={1} md={2} lg={3} className="g-4">
        {filteredProducts.map(product => (
          <Col key={product.id}>
            <ProductCard product={product} />
          </Col>
        ))}
      </Row>

      {filteredProducts.length === 0 && (
        <div className="text-center my-5">
          <h3>No products found</h3>
          <p>Try adjusting your search or filter criteria</p>
        </div>
      )}
    </Container>
  );
};

export default HomePage;
